import { AppBar, Toolbar } from "@mui/material";
import { Typography } from "@mui/material";
import { Link } from "react-router-dom";
import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import { UserContext } from "../../Contexts/UserContext/UserContext";
import { useContext } from "react";
import dayjs from "dayjs";
import { useState } from "react";
import IconButton from '@mui/material/IconButton';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import { useNavigate } from 'react-router-dom';


export default function MyAppBar(){

const {user, setUser} = useContext(UserContext);
const [isLoggedIn, setIsLoggedIn] = useState(false);
const [loginChecked, setLoginChecked] = useState(false);
const navigate = useNavigate();

const checkLogin = () => {

  if(!loginChecked){

      if(user != null && dayjs().isBefore(dayjs(user.logTime).add(6, 'hour'))){
          setIsLoggedIn(true);
      }
      setLoginChecked(true);
  }
}
checkLogin();

const [anchorEl, setAnchorEl] = useState(null);
const open = Boolean(anchorEl);
const handleClick = (event) => {
  setAnchorEl(event.currentTarget);
};
const handleClose = () => {
  setAnchorEl(null);
};

//could we do this just once on the app bar and pass it down somehow? through outlet?

const handleClickLogout = () => {
  setUser(null);
  navigate("/user/login");
}
const displayButton = () => {

  return(
    //person icon instead of mystuff? dropdown with option to log out??
    <div>
      {isLoggedIn ?
      <div>
        <IconButton
          onClick={handleClick}
        >
          <AccountCircleIcon fontSize="large"/>
        </IconButton>
        <Menu
          id="basic-menu"
          anchorEl={anchorEl}
          open={open}
          onClose={handleClose}
        >
          <Link style={{ textDecoration: 'none', color:"GrayText" }} to={'/mystuff'}>
            <MenuItem>My Stuff</MenuItem>
          </Link>
          <MenuItem onClick={handleClickLogout}>Logout</MenuItem>
        </Menu>
      </div>
      

      //<Link style={{ textDecoration: 'none' }} to={'/mystuff'}>
      //  <Button variant="contained" sx={{":hover": {
      //  bgcolor: "peachpuff"}, justifyContent:'right', backgroundColor:"lightsalmon"}}>My Stuff</Button>    
      //</Link>

      : 
      <Link style={{ textDecoration: 'none' }} to={'/user/login'}>
        <Button variant="contained" sx={{":hover": {
        bgcolor: "peachpuff"}, justifyContent:'right', backgroundColor:"lightsalmon"}}>Login
        </Button>    
      </Link>}
    </div>
  )
}
    return(

        <div>
            <AppBar position="static">
                <Toolbar sx={{backgroundColor:"sandybrown"}}>
                  <Grid container sx={{justifyContent: 'center', display: 'flex',
                  alignItems: 'center'}}>
                    <Grid item xs={2}/>
                    <Grid item sx={{justifyContent: 'center', display: 'flex',
                      alignItems: 'center'}} xs={5}>
                      <Typography variant="h4" sx={{margin:2}}>SpotFinder</Typography>
                    </Grid>
                    <Grid item xs={1.1}>
                      <Link  style={{ textDecoration: 'none' }} to={'/listings'}>
                        <Button variant="contained" sx={{":hover": {
                        bgcolor: "peachpuff"},justifyContent:'right', marginRight: 3, backgroundColor:"lightsalmon"}}>View Listings</Button>    
                      </Link>
                    </Grid>
                    <Grid item xs={.8}>
                      {displayButton()}
                    </Grid>
                  </Grid>
                </Toolbar>
            </AppBar>
        </div>
    )

}
